import React from 'react';
import './css/App.css';
import Header from './components/Header';
import Footer from './components/Footer';
import Navbar from './components/Navbar';
import {Link, Switch, Route} from 'react-router-dom'

function App () {
  return (
    <div className="App">
      <Navbar />

      <Switch>
        <Route exact path="/">
          im home page
          <Header />
        </Route>
        <Route path="/register">
          im registration page
        </Route>
      </Switch>

      <Footer />
    </div>
  );
}

export default App;
